package exemplo03;

public class Principal {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		//Variaveis
		int numero1=5 ,	numero2=5;
		
		
		//Operadores relacionais
		System.out.println(numero1>numero2); //maior
		System.out.println(numero1<numero2); //menos
		System.out.println(numero1>=numero2); //maior igual
		System.out.println(numero1<=numero2); //menor igual
		System.out.println(numero1 == numero2); //igualdade de valores 
		System.out.println(numero1 != numero2); //Diferente
		//System.out.println(numero1 === numero2); //igualdade de valores e tipos
		
		
		

	}

}
